import { useState } from 'react';

let nextId=0;
export default function Form() {
 const [name,setName]=useState('');
 const [food,setFood]=useState([]);

 return(
  <>
  <h1>料理ランクまとめ</h1>
  <input 
  value={name}
  onChange={e => setName(e.target.value)}
  />

  <button onClick={()=>{
    setFood([...food,{name:name,rank:nextId++}]);
  }}>Add</button>

  <ul>
    {food.map(f=>(
      <li key={f.rank}>名前:{f.name} ランク{f.rank}</li>
    ))}
  </ul>
  </>

 )
}
